import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
  color: red;
`;

export default function Index() {
  return (
    <div>
      <Title>GraphQL Job Board</Title>
      <p>A list of open GraphQL jobs</p>
    </div>
  );
}
